import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  InputAdornment,
  IconButton,
  Input
} from "@material-ui/core";
import "./LoginOrRegister.css";

class Login extends Component {
  render() {
    return (
      <div className="container">
        <h3>LOGIN</h3>
        <Container>
          <TextField
            className="textFieldStyle"
            label="Email"
            margin="dense"
            variant="filled"
          />
          <br />
          <Input
            id="adornment-password"
            className="textFieldStyle"
            type="password"
            label="Password"
            end
          />
          <br />
          <Button
            className="buttonStyle"
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "green",
              color: "white"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}

export default Login;
